import styled from "styled-components";
import LogoImg from "./citrus-logo.svg";

const StyledLogo = styled.div`
  width: 204px;
  height: 204px;
  border: solid 1px #fe5e41;
  border-radius: 50%;
  background-image: url({LogoImg});
`;

export default StyledLogo;
